// src/SwipeableComponent.js
import React, { useState } from 'react';
import SwipeableViews from 'react-swipeable-views';
import './OrderPage.module.css'; // Import your CSS file

const OrderPage = () => {
    const [activeIndex, setActiveIndex] = useState(0);

    const views = [
        { title: 'View 1', content: 'This is the content of View 1' },
        { title: 'View 2', content: 'This is the content of View 2' },
        { title: 'View 3', content: 'This is the content of View 3' },
    ];

    const handleChangeIndex = (index) => {
        setActiveIndex(index);
    };

    return (
        <div className="swipeable-container">
            <h1>Swipeable Views Example</h1>
            <SwipeableViews index={activeIndex} onChangeIndex={handleChangeIndex}>
                {views.map((view, index) => (
                    <div key={index} className="view">
                        <h2>{view.title}</h2>
                        <p>{view.content}</p>
                    </div>
                ))}
            </SwipeableViews>
            <div className="buttons">
                {views.map((_, index) => (
                    <button
                        key={index}
                        onClick={() => handleChangeIndex(index)}
                        className={activeIndex === index ? 'active' : ''}
                    >
                        View {index + 1}
                    </button>
                ))}
            </div>
        </div>
    );
};

export default OrderPage;
